INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('song1693145736584','Suomen kesä','Olli Halonen','Suomen kesä','pop','fi','2022','2023-08-27','2022-05-05T21:00:31Z','https://www.youtube.com/watch?v=rLWXzct4l7s','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1693145855706_Suomen%20kes%C3%A4.mp3?alt=media&token=5003c901-71ec-4f72-8e09-16df3a644381','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1693145849455_Suomen%20kes%C3%A4.jpg?alt=media&token=64db3c6d-6fb8-4e1d-b9ad-044c7fe33ccc','Suomen kesä kestää hetken aikaa vaan\nMut sen hetken maailma tarjoo parastaan\nMe näistä öistä kovaa hintaa maksetaan\nKu lopun vuotta pimeydessä palellaan\nMut sit kun yö on valoisa\nMe käydään rantaan istumaan\nJa Eput soittaa repullisen hittejään\nJa kanssa vesilintujen laulaa J. Karjalainen\nLuulen, et paratiisi on just tälläinen\nMe kesäyössä hiljaa istutaan\nJa aurinko taas värjää taivaan purppuraan\nValoisista öistä nautitaan\nEikä nyt oo aikaa mennä nukkumaan\nKun Suomen kesä on hetken vaan\nKoko talvi pitkää päivää ootetaan\nSe lyhenee ennenkuin loma ees alkaa\nSit hiukan kateellisina me seurataan\nLööpeistä et mihin poutaa luvataan\nMut sit kun jälkeen löylyjen\nIstutaan ääreen juomien\nJa kuunnellaan, kun Rauli laulaa laulujaan\nMä mökin rantaa tuijotan\nJa vaan niin paljon rakastan\nNäitä öitä Playa del Finlandian\nMe kesäyössä hiljaa istutaan\nJa aurinko taas värjää taivaan purppuraan\nValoisista öistä nautitaan\nEikä nyt oo aikaa mennä nukkumaan\nKun Suomen kesä on hetken vaan\nNyt yhtäaikaa tuopit ilmaan nostetaan\nMökkien laitureilla ja kesän festareilla\nKun sitten koko pitkä talvi muistellaan\nPlaya del Finlandiaa\nMe kesäyössä hiljaa istutaan\nJa aurinko taas värjää taivaan purppuraan\nValoisista öistä nautitaan\nEikä nyt oo aikaa mennä nukkumaan\nKun Suomen kesä on hetken vaan\nMe kesäyössä hiljaa istutaan\nJa aurinko taas värjää taivaan purppuraan\nValoisista öistä nautitaan\nEikä nyt oo aikaa mennä nukkumaan\nKun Suomen kesä on hetken vaan');
INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('song1693145894608','Auto jää','OfficialAnttiTuisku','OfficialAnttiTuisku','pop','fi','2023','2023-08-27','2023-04-27T21:00:33Z','https://www.youtube.com/watch?v=phFGtQETQTI','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1693145967115_Auto%20j%C3%A4%C3%A4.mp3?alt=media&token=364338ea-aea8-4fdb-b816-d38f768efcaa','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1693145951658_Auto%20j%C3%A4%C3%A4.jpg?alt=media&token=e16cd2d0-6545-4f15-82e9-78e75e8c4b39','… Terve, terve Antti\nTuu peremmälle vaan\nLähetää pittää hauskaa!\nSiun kanssa on aina niin mukavaa!\n(Hei!)\n… Ei töistä lähties tiedä ja aamulla varma on vielä\nEt raittiina rattiin ja kottiin vaan\nMut niin se mieli muuttuu ku järjen käyttö puuttuu\nJa eihän mul ois himas mitää muutenkaa\nJa sieltä se Kari taas pirauttaa mulle\nIlmassa alkaa jo olla se tunne\nTaas on aika kottiin ilmottaa\nTuisku, auta, lärvilauta!\nParempi vaan suoraan tunnustaa\n… Auto jää, auto jää\nKai sä huomenna autat ystävää\nKun hieman alkaa nyt siltä näyttämään\nEt auto jää, tättärää!\nAuto jää, auto jää\nNyt kun miettii ni tää on järkevää\nLuonto kiittää saadaan talous elpymään\nKun auto jää, auto jää\n… Tänäänhän tämä ei tästä liiku\nKolmio perään ja hätävilkut\nSiinä sulle parkkikikka ilmainen\nMeno on vähintään näppärää\nSaluunaan sisään ja tättärää\nTiistaina rankan viikon katkaisen\nTääl on muut, tääl on me\nTääl on meidän joukkue\n(Eikä kukaan nuorene)\n… Auto jää, auto jää (sehä jää!)\nKai sä huomenna autat ystävää (no tottakai!)\nKun hieman alkaa nyt siltä näyttämään\nEt auto jää (auto jää), tättärää! (tättärää)\nAuto jää (skrt skrt), auto jää (tyyt tyyt)\nNyt kun miettii ni tää on järkevää\nLuonto kiittää, saadaan talous elpymään\nKun auto jää, auto jää\n… Auto jää (auto jää), auto jää (auto jää)\nKai sä huomenna autat ystävää (ystävää)\nKun hieman alkaa nyt siltä näyttämään\nEt auto jää (auto jää), tättärää! (tättärää)\nAuto jää (auto jää), auto jää (Antti Tuisku!)\nNyt kun miettii ni tää on järkevää (järkevää)\nLuonto kiittää, saadaan talous elpymään\nKun auto jää, auto jää\nAuto jää (voi pojat)');
