INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('song1693146377316','Jälkeekään','Gettomasa','Jälkeekään','pop','fi','2023','2023-08-27','2023-06-01T21:00:10Z','https://www.youtube.com/watch?v=WiQLI5oL-Dw','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1693146434223_J%C3%A4lkeek%C3%A4%C3%A4n.mp3?alt=media&token=e4bce6ca-15a7-4631-b8e6-7c366d51e03c','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1693146444819_J%C3%A4lkeek%C3%A4%C3%A4n.jpg?alt=media&token=d93b1da7-5607-4a95-8eb5-aa45003a0894','&nbsp;Mä täytin just tankin\nNyt lyyään auto käyntiin ja sassiin\nSit hyppää vaa mun kiesiin, mentiin\nEi aikaa alkaa miettii tai empii\nEi oo suunnitelmaa, on vaa suunnillee\nMut sä tiiät et mä teen aina just sillee\nJa vois lähtee, vien sut pois täält\nSe mul ois plan, et muut noist jää, ja\nMitä jos mä (aha)\nJa sä (yeah yeah)\nMennään? (whoo)\nLähetään menemää eikä kerrota kellekkää (yeah)\nHävitään (ah)\nPois täält\nEi jätetä jälkeekään\nHaluut sä lähtee, haluut sä mennä?\nJohonki kauas, lähetään lentään\nTai mielummin ehkä vaa kävellään\nJohonki metsään tos lähellä\nSun kaa saahaan se tuntumaan seikkailult\nIlman sen hullumpaa reissailuu\nMun aiemmat suhteet, ne teki vaan mun elämäst raskaan\nMut sä enemmänki kevennät taakkaa\nKenenkään kanssa ei oo ollu niin helppoo\nKu ei oo juttuu mitä en vois kertoo\nEn tienny et se on mahollista\nEt sanoisin vaa mitä tahon\nIlman varomista, eikä tilanteesta muutu kaoottista\nJengi haluu elää postattuna\nMuttei meidän tarvi ottaa kuvaa\nVaan sä innostut sillon kun koodaan et millon tuut pyöräileen?\nMä aion oottaa sua, kerro\nMitä jos mä (aha)\nJa sä (yeah yeah)\nMennään? (whoo)\nLähetään menemää eikä kerrota kellekkää (aha)\nHävitään (tuu tuu)\nPois täält (yeah)\nEi jätetä jälkeekään\nIlta on valmis\nVoidaa nappaa fillarit tallist\nPari vanhaa kirpparimallist\nEi parhaitten asioitten hinta on kallis\nTuu, lähetään pois\nVoidaan plussaa meidät ja vähentää noi\nMä nään vaan sut, emmä nää ketää toist\nJa vaik ois, ne oo siel mis sä oot\nJoo mun ykkönen vielki sä oot, joten\nMitä jos mä (mitä?)\nJa sä (aha)\nMennään? (yeah yeah)\nLähetään menemää eikä kerrota kellekkää (mis meet?)\nHävitään (aha)\nPois täält (mitä?)\nEi jätetä jälkeekään');
