INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('song1693147017152','Makso Mitä Makso','Isac Elliot','Isac Elliot','pop','fi','2022','2023-08-27','2022-09-09T06:47:18Z','https://www.youtube.com/watch?v=5gkN7LsJE7k','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1693147110673_Makso%20Mit%C3%A4%20Makso.mp3?alt=media&token=f477e0c5-0c6e-429b-b742-f1b42d3d9393','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1693147078971_Makso%20Mit%C3%A4%20Makso.jpg?alt=media&token=786560a7-8948-4142-96ba-10938b035aa0','[Intro: Isac Elliot]\nMakso mitä makso\n[Säkeistö 1: Isac Elliot]\nEi pysty levähtää\nIlta jatkuu vaik oltais selällään\nNe koitaa ymmärtää mun elämää\nSe menee ylös alas, edes takas (Baby)\nMielellään, turha kiittää maksan mielellään (Mielellään)\nKunhan mun fiilis jatkuu pidempää\nEi-hei-hei, tuut menee ylös alas, edes takas\n[Kertosäe: Isac Elliot]\nAamu on jo ovel silti jenggii rullaa eteiseen, yeah\nSilmät pysyy auki edelleen\nMakso mitä makso, kuhan meijän ilta etenee, yeah\nJa nää mimmit pääsee leveilee\nPidä musta kiinni kun mun jalat alkaa kevenee, yeah\nMul on taskut täynnä edelleen\nMakso mitä makso kuhan meijän ilta etenee, yeah\nJa nää mimmit pääsee leveilee\n[Säkeistö 2: Sexmane]\nYeah, wow\nLupasin et en enää vedä, mut ympäril ihmiset tekee siit vaikeen\nOon valinnut tien, josta ei voi perääntyy\nMuuten mä menetän kaiken\nEi kukaan tee tätä sun puolest, ei ketään kiinnosta sun huolet\nEn voi edes kuvitella miten Isac oot kestänyt tätä niin nuorest (C''mon)\nMitä hittoo sit? Elän elämääni tää on meidän show\nTyhjensin kaks pulloo, lisää tulloo, bring some more\nJa mun viereinen beibi on janonen\nMä lupaan, se pitää jos sanon et en oo menos nukkuu, bro\nYou might also like\nYlläs\nSebastian Noto\nSata vuotta\nBEHM\nA&amp;W\nLana Del Rey\n[Kertosäe: Isac Elliot, Sexmane]\nAamu on jo ovel silti jenggii rullaa eteiseen, yeah\nSilmät pysyy auki edelleen\nMakso mitä makso kunhan meijän ilta etenee, yeah (Meil on massii, meil on massii)\nJa nää mimmit pääsee leveilee\nPidä musta kiinni kun mun jalat alkaa kevenee, yeah (Pidä musta kii)\nMul on taskut täynnä edelleen\nMakso mitä makso kuhan meijän ilta etenee, yeah\nJa nää mimmit pääsee leveilee (Pow, pow)\n[Outro: Isac Elliot]\nHa, ha, ha, ha, makso mitä makso\nHa, ha, ha, ha, makso mitä makso\nYeah, kuhan mimmit pääsee leveilee\nHa, ha, ha, ha, makso mitä makso\nHa, ha, ha, ha, makso mitä makso\nYeah, ja nää mimmit pääsee leveilee');
INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('song1693147127485','Päästä varpaisiin','behm','Warner Music Finland','pop','fi','2020','2023-08-27','2020-09-17T21:00:15Z','https://www.youtube.com/watch?v=eoY7fGWDH4c','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1693147200667_P%C3%A4%C3%A4st%C3%A4%20varpaisiin.mp3?alt=media&token=33f36724-413a-46f3-b40d-01ba77418828','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1693147195784_P%C3%A4%C3%A4st%C3%A4%20varpaisiin.jpg?alt=media&token=b93ead00-3f0c-41b7-ba9e-61f5fd8b738e','Osaan olla hiljaa ja huutaakin\nOsaan vähän ranskaa ja paljon muutakin\nKuka osaa kuulla kun sanat kadotin\nVoiko joku tuntea mut päästä varpaisiin\nEi kukaan kysy koskaan miten mä voin\nEnemmän kiinnostaa miten mun laulut soi\nMut onhan mussa paljon, paljon muutakin\nJos kysyisit niin saisit kaiken päästä varpaisiin\nMä haluun tuntee kaiken mitä sussa on\nTilanne on vaikee mut annan suunvuoron\nSä saat pitää kiinni mistä tahdotkin\nJos pidät mustakin aina päästä varpaisiin\nMä tarviin joskus aikaa etten sanois vaan\nMut sanat sai jo aikaan paljon pahempaa\nEn tarkoittanut lainkaan mitä sanoinkin\nNyt katuu mussa aivan kaikki päästä varpaisiin\nEi auta selitellä vaan koittaa muuttua\nTurha eritellä syitä joista suuttua\nAion pyytää anteeks ja sitä antaakin\nJos joku hyväksyisi kaiken päästä varpaisin\nMä oon tosi hellä mut joskus kuitenkin\nAvokämmenellä kaikki osuu kasvoihin\nEn lähelleni päästä ja siitä johtuukin\nKukaan ei voi tuntea mua päästä varpaisiin\nMut yli kaiken haluisin\nEt joku tuntis mut päästä varpaisiin');
